const TicketNavBar = (props) =>{




return(

<div className={classes.chatNavBar}>


  <TopIdBarLeft selectedCourse={props.selectedCourse}/>

  <TopLeftSearchBar/>

  <TicketBoxContainer onPress={props.onPress}  />


</div>	

);

}

